import React, { Component } from 'react';
import Bowl from './Ingredients/Bowl';
import Ingredients from './Ingredients/Ingredients';
import classes from './TestUI.module.css';
class TestUI extends Component {
    render() {
        return (
            <div className={classes.TestUI.container}>
                <div className={classes.TestUI.inner}>
                    <div class={classes.TestUI.child}><Bowl /></div>
                    <div class={classes.TestUI.child}><Ingredients imgName='lettuceBGfree.png' /></div>
                    <div class={classes.TestUI.child}><Ingredients imgName='quinoaBgfree.png' /></div>
                </div>
            </div>
        );
    };
}

export default TestUI;
